// src/components/Navbar.js

import React from 'react';
import { Link } from 'react-router-dom'; // For navigation, if using React Router

const Navbar = () => {
  return (
    <nav className="bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 p-5">
      <div className="max-w-screen-xl mx-auto flex justify-between items-center">
        <h1 className="text-white font-bold text-2xl">My Portfolio</h1>
        <ul className="flex space-x-6">
          <li><Link to="/" className="text-white hover:text-gray-200">Home</Link></li>
          <li><Link to="/about" className="text-white hover:text-gray-200">About</Link></li>
          <li><Link to="/contact" className="text-white hover:text-gray-200">Contact</Link></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
